import React, { useEffect, useState } from "react";
import axios from "axios";

function Users() {
  const [users, setusers] = useState([]);

  useEffect(() => {
    const fetchAllUsers = async () => {
      try {
        const res = await axios.get("http://localhost:3000/users");
        setusers(res.data)
      } catch (err) {
        console.log(err);
      }
    };

    fetchAllUsers();
  }, []);

  return (
    <div>
      <h1>Users List</h1>
      <div className="users">
        {users.map((user) => (
          <div className="user" key={user.id}>
            <tabe>
              <thead>
                <th>Name</th>
                <th>Phone</th>
                <th>Email</th>
              </thead>
              <tbody>
                <td>{user.name}</td>
                <td>{user.phone}</td>
                <td>{user.email}</td>
              </tbody>
            </tabe>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Users;
